import axios from 'axios';
import React, { Component } from 'react';
import Marquee from 'react-marquee-master';
import '../styles/Lists.scss';

export default class Lists extends Component {

    constructor() {
        super()
        this.state = {
            result: false,
        }

        this.lists = this.lists.bind(this);
    }

    lists(marqueeItems, marqueeItemsSecond) {

        console.log(marqueeItemsSecond);

        // const marqueeItems = ['One', 'Two', 'Three', 'One1', 'Two2', 'Three3'];
        // const marqueeItemsSecond = ['first', 'second', 'thrid', 'fourth', 'fifth', 'sixth'];

        return (
            <div height='300px' className='player-left'>
                <p className='listHeading'>Menu Heading</p>
                <Marquee minHeight='250' marqueeItems={marqueeItems} />
            </div>,
            <div height='300px' className='player-right'>
                <p className='listHeading'>Menu Heading</p>
                <Marquee minHeight='250' marqueeItems={marqueeItemsSecond} />
            </div>
        );
    }

    render() {

        const _this = this;

        let result = [];

        axios.defaults.headers.post['Access-Control-Allow-Origin'] = '*';
        axios.get('https://criminalimpulse.com/api/getTopPlayer', {
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
        })
            .then(function (response) {
                let listTopPlayer = response.data;
                _this.lists(listTopPlayer, listTopPlayer);
                _this.setState({
                    result: listTopPlayer
                })
            })
            .catch(function (error) {
                console.log(error);
            });

        return this.lists(result, result);
    }
}
